                <div className="img"></div>
                <div className="musicInfo">정보
                    <div className="name">노래이름</div>
                    <div className="singer">가수</div>
                </div>

            </div>
            {/* {data && data.map((music) => {
                return(
                    // <div>{music}</div>
                )
            })} */}
        </div>
    )
}

export default Chat;
